import React, { useState } from 'react'
import { Form, Tabs, Input, Select, Col, Row, Button, Modal, Tag, Slider, InputNumber } from 'antd'
import { CheckCircleFilled, EnvironmentOutlined, PlusCircleOutlined, PlusOutlined, SearchOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';
import Sucursales from '../components/Sucursales/Sucursales';
import Screendefault from '../components/Screens/Screendefault';
import Competencias from '../components/Competencias/Competencias';
import Warning from '../assets/img/iconos/atencion.svg'
import Avatar from '../assets/img/avatar.png';
import './Miempresa/Miempresa-edit.scss'


export default function Miempresa() {
    
    const { TabPane } = Tabs;

    const tabs = ['1',"2"];
    const [Active, setActive] = useState(tabs[0]);

    const changeActive = () => {
        if(Active === "1"){
            setActive(tabs[1]);
        }else{
            setActive(tabs[0]);
        }
    }


    return (
        <>
        <Tabs  className="tab" activeKey={Active}  onChange={changeActive}  type="card">
            <TabPane className="tabPane" tab="Estructura" key="1">
                
                
            </TabPane>
            <TabPane  className="tabPane" tab="Puesto" key="2">
               
            </TabPane>
        </Tabs>

        
       </>
       
    )
}
